import React from 'react';

function Summary(props) {
  console.log(props)
  const summaries = props.data.summaries.map((cv) => {
    return (
      <div class='list-group-item'>
        <dt class='list-group-item-heading'>{cv.title}</dt>
        <dd class='list-group-item-text'>{cv.text}</dd>
      </div>
    );
  });

  return (
    <div class="card" id="summary">
      <div class="card-header">Summary</div>
      <dl class="card-body list-group">
        {summaries}
      </dl>
    </div>
  );
}

class Resume extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      data: {}
    }
  }

  componentDidMount() {
    console.log('Component mounted')
    var loadedData = {};
    fetch("./resumeData.json")
      .then((resp) => resp.text()) // Transform the data into json
      .then((data) => loadedData = data);
    this.setState({'data':loadedData})
    console.log(loadedData)
  }

  render() {
    return (
      <div class="container">
        <div class="row">
          <div class="col-md-4 col-xs-5">


            <div class="panel panel-default" id="education">
              <div class="panel-heading">
                <h2 class='panel-title'>Education</h2>
              </div>
              <dl class="panel-body list-group">
                <div class='list-group-item'>
                  <dt class='list-group-item-heading'>University of Michigan</dt>
                  <dd class='list-group-item-text'>BA in Russian and Eastern European Studies (2000-2004)</dd>
                </div>
              </dl>
            </div>

            <div class="panel panel-default" id="languages">
              <div class="panel-heading">
                <h2 class='panel-title'>Languages</h2>
              </div>
              <ul class="panel-body list-unstyled">
              </ul>
            </div>

            <div class="panel panel-default" id="skills">
              <div class="panel-heading">
                <h2 class='panel-title'>Development Skills</h2>
              </div>
              <ul class="panel-body list-unstyled">
              </ul>
            </div>

          </div>



          <div class="col-md-8 col-xs-7">
            <div class="panel panel-default" id="experiences">
              <div class="panel-heading">
                <h2 class='panel-title'>Experience</h2>
              </div>
              <div class="panel-body"></div>
            </div>
          </div>
        </div>

      </div>

    );
  }
}

export default Resume;
